A simple, yet powerful look-book tool for creating unique outfits with limited number of clothes for every style, budget, wardrobe efficiency, or environment conscious person. Developed by experienced fashion professionals, this free app will show you how to create winning outfits with one click and feel confident in the way you dress and look.

Ever wondered what to wear today to the office? Created with the “capsule wardrobe” idea in mind, Dress-Me App gives you more than 100 style and outfit inspirations for smart casual and formal dress codes. The app takes into account your individual style preferences, as well as the budget. Did you know that with just 20 essential items you can create up to 30 unique outfits for a whole month? 

FEATURES:
	•	Automatically generate winning outfits for major wearing occasions: Office, Smart Casual, Going Out, City Break in either Formal or Relaxed styles (FITTING ROOM);
	•	Model your looks in the FITTING ROOM by mixing and matching items freely;  
	•	Add your favorite outfits to SAVED LOOKS for a hassle-free morning routine;
	•	Discover timeless must-have clothes to keep your wardrobe versatile and functional (ESSENTIAL ITEMS);
	•	Create a SHOPPING LIST of the clothes you need to buy;
	•	Get personalized advice on how to revamp your style and where to buy the clothes you need.  


